import Link from 'next/link';
import Head from 'next/head'

const Index = () => {
  return (
    <div className='index'>
      <Head><title>Home Page</title></Head>
      <div>
        <Link href="/"><a className='nav-logo'>Mercado Libre</a></Link>
      </div>
      <div className='input'>
        <input className='nav-search-input' onChange={event => console.log(event.target.value)}/>
        <Link href="/items"><a>Press</a></Link>
      </div>
      <div/>
    </div>
  )
}

export default Index
